1. Веду консультации по ведической астрологии Джйотиш:   

- консультация взрослого человека и разбор карты для ребёнка содержит:   
Описание личности;  
Мотивация и интересы;  
Таланты;  
Задачи на эту жизнь;  
Предназначение по профессии; 
Отношения с родителями;  
Партнёр по браку и дети; 
Анализ чакр;  
Прогнозирование по астрологическим периодам человека;  
Рекомендации по гармонизации ослабленных сфер жизни.  
Стоимость консультации для взрослого человека 2500 рублей.
Стоимость консультации для ребенка 1500 рублей.

- совместимость пар:  
Разбор карты обоих партнеров; 
Влияние партнеров друг на друга по натальной карте и чакрам;  
Рекомендации по гармонизации карт.
Стоимость консультации 5000 рублей.

2. Веду консультации по нумерологии. Консультация для взрослого человека и ребенка содержит:  
Определение мировоззрения человека;  Определение кармического пути; Определение способа решения кармических задач;  
Построение янтры личности;  
Определение числа периода жизни человека;  
Определение числа года;  
Совместимость партнеров;  
Построение янтры для бизнеса, работы. 
Стоимость консультации 1500 рублей. 

3. Составляю проект Ваасту по жилому помещению и коммерческому. 
Консультация содержит:  
Построение карты по расположению зон в помещении; 
Расположение чакр на карте помещения; Определение лучшей зоны для сна, размещения рабочего стола, детской комнаты; 
 Рекомендации по гармонизации зон в помещении
Стоимость консультации 2500 рублей.
